import React from "react";
import flovers from "./flover_type/flovers.json";

export const FloverOptions = () => {
  const floverList = Object.entries(flovers);

  return floverList.map((el, number) => {
    return (
      <div>
        <img src={`bouquet_${number}`.img_src} alt={`bouquet_${number}`.name} />
        <span>{`bouquet_${number}`.name}</span>
        <select
          name="Number of flovers"
          class="ChoosingFlowers__container__select"
        >
          {floverList.map((el, number) => {
            return (
              <option value={`bouquet_${number}`.options[`option_${number}`]}>
                {`bouquet_${number}`.options[`option_${number}`]}
              </option>
            );
          })}
        </select>
      </div>
    );
  });
};
